jQuery(document).ready(function(){

  var jQueryhorizontalScroll = {
		jQueryhorizontalScrollWrapper : jQuery('#horizontalScrollBox'),
		jQueryhorizontalScrollContent : jQuery('#horizontalScrollBox .portfolios-grid'),
		jQueryhorizontalScrollItem    : jQuery('#horizontalScrollBox .portfolio-grid'),

		build: function(){
			var self = this;

			self.setContentWidth();
           jQuery('#horizontalScrollBox').append('<div class="custom-portfolio-navigation"><div class="prev"></div><div class="next"></div></div>');
			self.buttonNavigation();
			self.disableEnableButtons();
		},
		setContentWidth: function(){
			var self       = this,
				totalWidth = 0;

			jQuery(self.jQueryhorizontalScrollItem).each(function(e){
				var boxImageWidth = jQuery(this).outerWidth(true);

				totalWidth = (totalWidth + boxImageWidth) + 3.5;
			});

			self.jQueryhorizontalScrollContent.width( totalWidth );
		},
		isElementInView: function (element, fullyInView) {
	        var pageLeft = jQuery(window).scrollLeft(),
	        	pageRight = pageLeft + jQuery(window).width(),
	        	elementLeft = jQuery(element).offset().left,
	        	elementRight = elementLeft + jQuery(element).width();

	        if (fullyInView === true) {
	            return ((pageLeft < elementLeft) && (pageRight > elementRight));
	        } else {
	            return ((elementLeft <= pageRight) && (elementRight >= pageLeft));
	        }
	    },
	    buttonNavigation: function() {
	    	var self            = this,
	    		nextButton      = self.jQueryhorizontalScrollWrapper.find('.custom-portfolio-navigation .next'),
	    		prevButton      = self.jQueryhorizontalScrollWrapper.find('.custom-portfolio-navigation .prev'),
				totalItems      = self.jQueryhorizontalScrollItem.length - 1,
				screen          = 0,
				distance 		= 0,
				index           = 0,
				flag            = false,
				atualItem;

			prevButton.on('click', function(){
				if( !flag ){
			    	flag = true;

			        if( index > 0 ) {
			        	index--;
			        }
					atualItem  = self.jQueryhorizontalScrollItem.eq(index);

					// Check if Element in View
					var isElementInView = self.isElementInView(atualItem, false);
				    if( !isElementInView ) {
				    	self.jQueryhorizontalScrollItem.each(function(){
				    		var inView = self.isElementInView(jQuery(this), false);

				    		if( inView ) {
				    			atualItem = jQuery(this);
				    			return false;
				    		}
				    	});
				    }

				    screen    = (jQuery(window).width() - atualItem.outerWidth(true)) / 2;
				    distance  = (atualItem.position().left - screen);

		    		jQuery('#horizontalScrollBox').animate({ scrollLeft: distance }, 300, function(){
			    		flag = false;
			    	});
				}
			});

			nextButton.on('click', function(){

				if( !flag ){
			        flag = true;

			        if( index < totalItems ) {
			        	index++;
			        }
			        atualItem = self.jQueryhorizontalScrollItem.eq(index);

			        // Check if Element in View
				    var isElementInView = self.isElementInView(atualItem, false);
				    if( !isElementInView ) {
				    	self.jQueryhorizontalScrollItem.each(function(){
				    		var inView = self.isElementInView(jQuery(this), false);

				    		if( inView ) {
				    			atualItem = jQuery(this);
				    			index = jQuery(this).index();
				    			return false;
				    		}
				    	});
				    }

                    screen = ((jQuery(window).width() - 255 ) - atualItem.outerWidth(true)) / 2;
				    distance  = (atualItem.position().left - screen);

		    		jQuery('#horizontalScrollBox').animate({ scrollLeft: distance }, 300, function(){
			    		flag = false;
			    	});
				}
			});
	    },
	    disableEnableButtons: function(){
	    	var self = this,
	    		nextButton      = self.jQueryhorizontalScrollWrapper.find('.custom-portfolio-navigation .next'),
	    		prevButton      = self.jQueryhorizontalScrollWrapper.find('.custom-portfolio-navigation .prev');

	    	self.jQueryhorizontalScrollWrapper.on('scroll', function(){
	    		if( jQuery(this).scrollLeft() == 0 ) {
		    		prevButton.addClass('disable-button');
		    	} else {
		    		prevButton.removeClass('disable-button');
		    	}

		    	if( jQuery(this).scrollLeft() > ((self.jQueryhorizontalScrollContent.width() - jQuery(window).width()) - 1) ) {

		    		nextButton.addClass('disable-button');
		    	} else {
		    		nextButton.removeClass('disable-button');
		    	}
	    	});
	    }
	}

	if(jQuery('#horizontalScrollBox').get(0)) {
		jQueryhorizontalScroll.build();

		// if jquery.mousewheel plugin is installed we can prevent out-of-bounds scrolling of results via mousewheel
            if (jQuery.fn.mousewheel) {
				// Mousewheel horizontal scroll
                jQuery('#horizontalScrollBox').mousewheel(function(event, delta) {
                    this.scrollLeft -= (delta * 60);
                    event.preventDefault();
                });
        }

		// Build $horizontalScroll on resize
		var flag2 = true;

		jQuery(window).on('resize', function(){
			if(jQuery('#horizontalScrollBox').get(0) && flag2 == true) {
				setTimeout(function(){
					jQueryhorizontalScroll.setContentWidth();

					flag2 = true;
				}, 1000);

				flag2 = false;
			}
		});
	}


});

